import React from "react";
import {
  OverviewContainer,
  RightContainer,
  Title,
  MainText,
  SubText,
} from "./OverviewElements";

const Overview = () => {
  return (
    <>
      <OverviewContainer>
        <RightContainer>
          <Title>OVERVIEW</Title>
          <MainText>More than 56'112 analysed tweets.</MainText>
          <SubText>
            Over 20 brands and companies, with more than 60 products to cover.
          </SubText>
        </RightContainer>
      </OverviewContainer>
    </>
  );
};

export default Overview;
